import React, { Component } from 'react'


class RenderDOM extends Component {
    Change(){
        alert("hhh")
    }
    render() {
        return (
            <div>
                <h1> React Dom Project </h1>
                <h2>render DOM</h2>
                <p> render() -> ReactDOM.render( element, container[, callback] ) </p>
                <button className="btn-denger" onClick={ this.Change }> change name </button>
                <h2> developer green </h2>
            </div>
        )
    }
}
export default RenderDOM
